import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css'

function Login() {
  return (
    <div className="container-fluid">
      <div id="login-body" className="row justify-content-center">
          <div className="col-1 col-sm-2 col-md-5 col-xl-4 pos-relative">
            <div id="gg-login-container" className="card rounded-0 border-0 shadow-sm p-3">
                <a href="#!" className="small text-right">login</a>
                <div class="row">
                  <div class="col">
                    12
                  </div>
                </div>
            </div>
          </div>
      </div>
    </div>
  );
}

export default Login;
